import React from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import Header from "./shared/Components/Header/Header";
import UploadButtons from "./shared/Components/UploadButtons/UploadButtons";

const App = () => {

    return (
        <BrowserRouter>
            <Switch>
                <Route path="/about" component={UploadButtons}/>

                <Route/>
            </Switch>
        </BrowserRouter>
    );
};

export default App;
